@extends('layouts.app_uipj')
@section('css')
<style type="text/css">
.human-body {
    width: 207px;
    position: relative;
    margin-left: 40px;
    /*padding-top: 240px;*/
    /*height: 260px;*/
    display: block;
    /*margin: 40px auto;*/
}
.human-body svg:hover {
    cursor: pointer;
    transition: transform .2s;
    transform: scale(1.5);

}
.human-body svg:hover path {
    fill: #ff7d16;
}
/*.human-body svg {
    position: absolute;
    left: 50%;
    fill: #57c9d5;
}*/


.human-body svg g path{
    position: absolute;
    left: 50%;
    fill: black;
}


#area {
    display: block;
    width: 100%;
    clear: both;
    padding: 10px;
    text-align: center;
    font-size: 25px;
    font-family: Courier New;
    color: #a5a5a5;
}

#area #data {
    color: black;
}
</style>
@endsection

@section('content')

<div id="area">
  Area: <span id="data"></span>
  @include('includes.partesCuerpo.01ModalCabello')
</div>

